INSERT INTO `wp_postmeta` VALUES (5131,5,'section_four_content','<strong>Panish Shea &amp; Boyle LLP is a nationally recognized plaintiffs personal injury law firm located in California and Nevada. Our trial lawyers focus solely on injury claims and are dedicated to protecting the rights of seriously injured people throughout the country.</strong>\r\n\r\nPSB Playbook is a plaintiffs-only webinar series showcasing the tactics, strategies and concepts implemented by Panish Shea &amp; Boyle LLP attorneys as they work up a personal injury case.\r\n\r\nEach of the firm’s webinars feature speakers using case examples and who are joined by various guest experts in their respective fields to discuss take-away methods that can be implemented by plaintiff lawyers in their own cases.');
